fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:processed_pork_meat_food_product rdfs:subClassOf :pork_meat_food_product,
        :processed_meat_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :processed_meat_food_product ;
                    rdf:rest [ rdf:first :pork_meat_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spice_or_herb rdfs:subClassOf :condiment_food_product,
        :plant_food_product ;
    :has_definition "A vegetable product such as leaves, flowers, seeds and roots that is rich in essential oils and aromatic principles. Used mainly a a condiment."@en ;
    :has_exact_synonym "herb and spice"@en,
        "herb or spice"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coffee_beverage rdfs:subClassOf :coffee_based_beverage_product ;
    :has_definition "A brewed drink prepared from roasted seeds, commonly called coffee beans, of the coffee plant."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tea_beverage_liquid_ rdfs:subClassOf :tea_based_beverage_product ;
    :has_definition "A beverage prepared from the cured leaves of Camellia sinensis by combination with hot or boiling water."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fish_food_product rdfs:subClassOf :vertebrate_animal_food_product ;
    :has_definition "A fish food product includes products made from any fish species (aquatic vertebrate with gills and fins)."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_derived_fermented_beverage rdfs:subClassOf :fermented_beverage,
        :plant_derived_beverage ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :fermented_beverage ;
                    rdf:rest [ rdf:first :plant_derived_beverage ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dairy_food_product rdfs:subClassOf :vertebrate_animal_food_product ;
    :has_definition "A dairy food product has mammilian milk or a milk component as an ingredient."@en ;
    :has_exact_synonym "dairy product"@en,
        "milk product"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beer_beverage rdfs:subClassOf :fermented_grain_beverage ;
    :has_definition "Beer is a fermented cereal beverage resulting from the fermentation most commonly of malted barley (though wheat, corn, or rice may included), by a yeast, most commonly Saccharomyces cerevisiae, and flavored by dried flowers of hops, Humulus lupulus."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vegetable_food_product rdfs:subClassOf :plant_food_product ;
    :has_definition "Any plant food product which, typically, is constituted by intact parts from one or more annual plants cultivated as field and garden crops in the open and under glass, and used almost exclusively for food."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:legume_food_product rdfs:subClassOf :botanical_fruit_food_product ;
    :has_definition "A one-celled fruit (pod) usually dehiscing down both sutures, and having the seed attached along a ventral suture. (Roubik 1995)" ;
    :has_exact_synonym "legume"@en ;
    :has_narrow_synonym "http://purl.obolibrary.org/obo/FOODON_03411254"^^xsd:anyURI,
        "http://purl.obolibrary.org/obo/FOODON_03411338"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hen_egg_food_product rdfs:subClassOf :avian_egg_food_product ;
    :has_definition "A hen egg food product is any food product consisting mainly of hen eggs or derivatives."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:apple_cider_alcoholic_ rdfs:subClassOf :fermented_apple_beverage ;
    :has_definition "Cider, hard apple cider, or hard cider in the US, is an alcoholic beverage made from the fermented juice of apples."@en ;
    :has_exact_synonym "cider" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:custard_dessert_food_product rdfs:subClassOf :cow_milk_dessert,
        :food_cooked_ ;
    :has_definition "A food involving whipped and cooked milk, sugar and egg yolk mixtures."@en ;
    :has_exact_synonym "sweet custard"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ground_beef_food_product rdfs:subClassOf :beef_food_product ;
    :has_definition "A ground beef product is made of beef that has been finely chopped with a knife or a meat grinder (American English) or mincing machine (British English). Ground beef is used in many recipes including hamburgers and spaghetti Bolognese."@en ;
    :has_exact_synonym "beef mince",
        "hamburger meat",
        "minced beef",
        "beef mince"@en,
        "ground beef"@en ;
    :image :631px__hackfleisch_1.jpg .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:poultry_food_product rdfs:subClassOf :avian_food_product ;
    :has_definition "A food product from a category of domestic birds kept for meat, eggs, and feathers including fowl such as chickens, turkeys, and waterfowls such as domestic ducks and geese and other meat birds such as pigeons and doves and games birds including pheasants." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:turkey_meat_food_product rdfs:subClassOf :poultry_meat_food_product ;
    :has_definition "A turkey meat food product is any food product made predominantly of turkey parts."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cantaloupe_fruit_food_product rdfs:subClassOf :muskmelon_cucumis_melo_fruit_food_product ;
    :has_definition "Cantaloupe (also known as muskmelon (India and the United States), mushmelon, rockmelon (in Australian states and in New Zealand), sweet melon, spanspek (South Africa), or capuchin (Scotland) refers to a variety of the Cucumis melo species in the Cucurbitaceae family."@en ;
    :has_exact_synonym "cantaloup",
        "muskmelon" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salad_dressing rdfs:subClassOf :condiment_food_product,
        :plant_product_dressing ;
    :has_definition "A sauce for a salad."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pecorino_cheese rdfs:subClassOf :sheep_milk_cheese_food_product ;
    :has_definition "A family of hard Italian cheeses made from sheep milk." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:apple_vinegar_food_product rdfs:subClassOf :apple_condiment,
        :apple_food_product,
        :vinegar_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vinegar_food_product ;
                    rdf:rest [ rdf:first :apple_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:barley_flour_food_product rdfs:subClassOf :barley_food_product,
        :flour_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :flour_food_product ;
                    rdf:rest [ rdf:first :barley_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bean_food_product rdfs:subClassOf :legume_food_product,
        :plant_seed_vegetable_food_product ;
    :has_definition "A bean vegetable food product is a human or animal food product - such as a snap, shell or dry bean product - derived from the fruit pod, seed, or leaf of one of several genera of the flowering plant family Fabaceae."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:broad_bean_food_product rdfs:subClassOf :bean_food_product ;
    :has_definition "A broad bean food product is a product derived from the broad bean plant."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cabbage_juice_food_product rdfs:subClassOf :cabbage_food_product,
        :vegetable_juice_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cabbage_food_product ;
                    rdf:rest [ rdf:first :vegetable_juice_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cattle_cured_meat_food_product rdfs:subClassOf :beef_food_product,
        :cured_meat_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cured_meat_food_product ;
                    rdf:rest [ rdf:first :beef_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_product_component rdfs:subClassOf :food_product ;
    :has_definition "A food product which normally exists as an ingredient to another food product, rather than eaten on its own, and is more complex than a chemical food component."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cocoa_beverage rdfs:subClassOf :cocoa_food_product,
        :plant_derived_beverage ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :plant_derived_beverage ;
                    rdf:rest [ rdf:first :cocoa_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frozen_dairy_dessert rdfs:subClassOf :dairy_dessert_food_product,
        :frozen_dairy_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :dairy_dessert_food_product ;
                    rdf:rest [ rdf:first :frozen_dairy_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fruit_salad_food_product rdfs:subClassOf :plant_based_salad_food_product,
        :plant_fruit_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :plant_fruit_food_product ;
                    rdf:rest [ rdf:first :plant_based_salad_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leguminous_vegetable_food_product rdfs:subClassOf :legume_food_product ;
    :has_definition "A food product made from legumes that are considered vegetables, such as immature raw legume pods or seeds."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pigeon_pea_vegetable_food_product rdfs:subClassOf :leguminous_vegetable_food_product,
        :pea_food_product,
        :pigeon_pea_food_product ;
    :has_definition "A product containing primarily immature ripe pigeon peas."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_based_bakery_food_product rdfs:subClassOf :bakery_food_product,
        :multi_component_plant_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :bakery_food_product ;
                    rdf:rest [ rdf:first :multi_component_plant_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_based_candy rdfs:subClassOf :candy_food_product,
        :multi_component_plant_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :candy_food_product ;
                    rdf:rest [ rdf:first :multi_component_plant_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_fat_or_oil_refined_food_product rdfs:subClassOf :plant_based_refined_or_partially_refined_food_product,
        :plant_lipid_food_product ;
    :has_definition "An edible plant fat or oil product with characteristics that consumers desire such as bland flavour and odour, clear appearance, light colour, stability to oxidation and suitability for frying, and which is the result of a refining process that removes free fatty acids."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_fruit_as_vegetable_food_product rdfs:subClassOf :plant_fruit_food_product ;
    :has_definition "A plant fruit food product which is labeled (in common language or by regulation) as a vegetable food product."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_product_dressing rdfs:subClassOf :food_dressing_product,
        :multi_component_plant_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :food_dressing_product ;
                    rdf:rest [ rdf:first :multi_component_plant_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_seed_based_bakery_food_product rdfs:subClassOf :plant_based_bakery_food_product,
        :plant_seed_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :plant_seed_food_product ;
                    rdf:rest [ rdf:first :plant_based_bakery_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_stem_or_spear_vegetable_food_product rdfs:subClassOf :plant_stem_food_product,
        :vegetable_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :plant_stem_food_product ;
                    rdf:rest [ rdf:first :vegetable_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prepared_hen_egg_product rdfs:subClassOf :hen_egg_food_product,
        :prepared_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :prepared_food_product ;
                    rdf:rest [ rdf:first :hen_egg_food_product ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A prepared hen egg product is a product predominantly made of hen egg that has been cooked and may only require defrosting or reheating for consumption."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soybean_food_product rdfs:subClassOf :bean_food_product,
        :soybean_seed_field_food_product ;
    :has_definition "A soybean food product is a product derived from the soybean plant."@en ;
    :has_exact_synonym "soy product"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pork_cured_meat_food_product rdfs:subClassOf :cured_meat_food_product,
        :processed_pork_meat_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :pork_meat_food_product ;
                    rdf:rest [ rdf:first :cured_meat_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tomato_juice_food_product rdfs:subClassOf :tomato_food_product,
        :vegetable_juice_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :tomato_food_product ;
                    rdf:rest [ rdf:first :vegetable_juice_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_product_by_meal_type rdfs:subClassOf :food_product ;
    :has_definition "A meal type is the name of an eating occasion that may have location, food type, or other customary contextual features. (Damion's 1st draft definition)"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_product_by_organism rdfs:subClassOf :food_product ;
    :has_definition "A food product consisting of food material derived primarily from a single organism."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_material rdfs:subClassOf :environmental_material ;
    :has_definition "Any substance that can be consumed by an organism to satisfy nutritional or other health needs, or to provide a social or organoleptic food experience"@en ;
    :has_exact_synonym "food"@en,
        "foodstuff"@en,
        "nourishment"@en,
        "sustenance"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multi_component_honey_product rdfs:subClassOf :honey_food_product,
        :multi_component_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :honey_food_product ;
                    rdf:rest [ rdf:first :multi_component_food_product ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_product_by_quality rdfs:subClassOf :food_product ;
    :has_definition "A class which contains food product categories qualified by a quality such as granularity or temperature, which is useful for tasks like food inspection where little prior knowledge of how the food came to be is available. Some terms like \"food (frozen)\" are both a quality descriptor and the output of a process."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multi_component_food_product rdfs:subClassOf :food_product ;
    :has_definition "A food product consisting of food material derived from ingredients sourced from multiple organisms."@en ;
    :has_synonym "multi-ingredient"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_dehydrated_ rdfs:subClassOf :food_preserved_ ;
    :has_definition "A preserved food, where the moisture levels in the food product have been reduced to low levels to improve shelf life."@en ;
    :has_synonym "food (dessicated)"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_product_by_process rdfs:subClassOf :food_product ;
    :has_definition "A food product organized by the process which it results from."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipid_food_product rdfs:subClassOf :extract_concentrate_or_isolate_of_plant_or_animal ;
    :has_definition "A lipid food product is a food product made primarily of plant or animal fat or oil"@en ;
    :has_exact_synonym "fats and oils"@en,
        "oils and fats"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bean_whole_dried_ rdfs:subClassOf :bean_whole_,
        :food_dried_ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :bean_whole_ ;
                    rdf:rest [ rdf:first :food_dried_ ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A whole dried bean is a bean resulting from natural or mechanical air drying applied to a bean or bean pod."@en ;
    :has_exact_synonym "dried bean"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bean_whole_ rdfs:subClassOf :bean_food_product ;
    :has_definition "A seed of a bean plant from one of several genera of the flowering plant family (Fabaceae)."@en ;
    :has_exact_synonym "bean"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bean_cooked_ rdfs:subClassOf :bean_substance,
        :food_cooked_ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :food_cooked_ ;
                    rdf:rest [ rdf:first :bean_substance ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Cooked bean material is the bean material output of a cooking process applied to dry, rehydrated, or raw (fresh) beans."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jack_bean_whole_ rdfs:subClassOf :bean_whole_,
        :jack_bean_food_product ;
    :has_definition "A seed of a jack seed plant (Canavalia ensiformis)."@en ;
    :has_exact_synonym "jack bean"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pigeon_pea_food_product rdfs:subClassOf :legume_food_product ;
    :has_definition "A pigeon pea food product is a food product derived from the pigeon pea plant"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pigeon_pea_whole_ rdfs:subClassOf :pigeon_pea_vegetable_food_product ;
    :has_definition "A seed of a pigeon pea plant (Cajanus cajan)."@en ;
    :has_exact_synonym "pigeon pea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:velvet_bean_whole_ rdfs:subClassOf :bean_whole_,
        :velvet_bean_food_product ;
    :has_definition "A seed of a  velvet bean plant (Mucuna pruriens)"@en ;
    :has_exact_synonym "tericopelo bean"@en,
        "velvet bean"@en,
        "tericopelo bean"@es .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vetch_seed_whole_ rdfs:subClassOf :vetch_food_product ;
    :has_definition "A seed of a vetch plant."@en ;
    :has_exact_synonym "vetch seed"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liver_food_product rdfs:subClassOf :organ_meat_product ;
    :has_definition "A liver food product is a food product that derives from one or more liver organs."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:velvet_bean_food_product rdfs:subClassOf :bean_food_product ;
    :has_definition "A bean food product made from velvet bean."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_food_product rdfs:subClassOf :food_product_by_organism ;
    :has_definition "A food product deriving from one or more animals."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:broad_bean_whole_ rdfs:subClassOf :bean_whole_,
        :broad_bean_food_product ;
    :has_definition "A seed of a broad bean plant (Vicia faba)."@en ;
    :has_exact_synonym "Windsor bean"@en,
        "broad bean"@en,
        "broadbean"@en,
        "faba bean"@en,
        "fava bean"@en ;
    :has_narrow_synonym "Horse bean"@en,
        "field bean"@en,
        "tic bean"@en,
        "tick bean"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bean_substance rdfs:subClassOf :bean_food_product ;
    :has_definition "A bean substance is a substance made by processing seed from a bean plant."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beverage_food_product rdfs:subClassOf :food_product_by_meal_type ;
    :has_definition "A liquid prepared for consumption, or a product that can be combined with water or milk to make one."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beef_dehydrated_ rdfs:subClassOf :beef_food_product,
        :food_dehydrated_ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :beef_food_product ;
                    rdf:rest [ rdf:first :food_dehydrated_ ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cultured_dairy_product rdfs:subClassOf :fermented_dairy_food_product ;
    :has_definition "A cultured dairy product is a fermented dairy product in which a microbial starter was introduced to the fermentation process."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:honey_blend_table_syrup rdfs:subClassOf :multi_component_honey_product,
        :plant_sweetener ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :plant_sweetener ;
                    rdf:rest [ rdf:first :multi_component_honey_product ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pork_dehydrated_ rdfs:subClassOf :food_dehydrated_,
        :pork_meat_food_product ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :pork_meat_food_product ;
                    rdf:rest [ rdf:first :food_dehydrated_ ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fish_product_unspecified_species_ rdfs:subClassOf :fish_food_product ;
    :has_definition "A fish product is a home-made or commercially produced or retail or wholesale product containing substantial amounts of freshwater or saltwater fish and/or shellfish flesh. Note that this category should avoid items that mention a particular species of fish or shellfish."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sausage_whole_ rdfs:subClassOf :sausage_food_product ;
    :has_definition "A food product that is highly seasoned minced meat and is encased in a skin in the shape of a cylinder."@en ;
    :has_exact_synonym "sausage"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meat_whole_or_parts_ rdfs:subClassOf :mammalian_meat_food_product ;
    :has_definition "A meat product is a product organized by the form of - or processing done to - its meat component (a skeletal meat part of an animal or crustacean)."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cheese_or_cheese_product_us_cfr_ rdfs:subClassOf :dairy_product_us_cfr_ ;
    :has_definition "Natural cheese, cured or uncured, cheese product (which is further processed), or cheese product analog."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fruit_or_fruit_product_us_cfr_ rdfs:subClassOf :fruit_or_vegetable_product_us_cfr_ ;
    :has_definition "Fruit in all forms; includes fruit juices and fruit juice drinks, fruit butters, jellies, preserves, and related products."@en ;
    :has_synonym "pie filling, fruit"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:milk_or_milk_product_analog_us_cfr_ rdfs:subClassOf :milk_or_milk_product_us_cfr_ ;
    :has_definition "Food product having functional characteristics similar to milk or milk products, including cream product analogs, margarine, and milk analogs. Certain alternate ingredients are substituted for those components that are responsible for specific functional properties."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:milk_or_milk_product_us_cfr_ rdfs:subClassOf :dairy_product_us_cfr_ ;
    :has_definition "Milk in all forms, milk-based beverage, cultured milk product, or milk or milk product analog. Index infant formula under *MEAL REPLACEMENT*."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fruit_butter_jelly_preserve_or_related_product_us_cfr_ rdfs:subClassOf :fruit_or_fruit_product_us_cfr_ ;
    :has_definition "Semisolid or jelled food prepared from fruit or fruit juice and other ingredients prescribed for the individual products (21 CFR 150)."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dairy_product_us_cfr_ rdfs:subClassOf :u_s_code_of_federal_regulations_title_21_food_product_type ;
    :has_definition "Milk, a product derived from milk, or a dairy product analog; includes cheese and frozen dairy desserts. [FDA CFSAN 1995]"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:natural_cheese_us_cfr_ rdfs:subClassOf :cheese_or_cheese_product_us_cfr_ ;
    :has_definition "Cheese made from milk or milk components, such as cream, by the following process: (1) produce curd through coagulation of milk by bacterial action and/or enzymes and/or acidification and draining of whey. (2) For cured cheese only: cure the curd. Excludes products made through further processing, such as comminuting (see *CHEESE PRODUCT*)."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:confectionery_us_cfr_ rdfs:subClassOf :u_s_code_of_federal_regulations_title_21_food_product_type ;
    :has_definition "Candy or other food product made with sweeteners and frequently containing nuts, fruits, starches, flavorings and other foods (21 CFR 170.3(n)(9). [FDA CFSAN 1995]"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:candy_us_cfr_ rdfs:subClassOf :confectionery_us_cfr_ ;
    :has_definition "Food product prepared by heating a mixture of sweeteners and other optional ingredients according to the specific formula for each subgroup."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fruit_jelly_us_cfr_ rdfs:subClassOf :fruit_butter_jelly_preserve_or_related_product_us_cfr_ ;
    :has_definition "Jelled product made from one or more fruit juices and optional ingredients. Includes both fruit jelly, which may be sweetened with nutritive carbohydrate sweeteners, (21 CFR 150.140), and artificially sweetened fruit jelly (21 CFR 150.141). The finished fruit jelly must have a soluble solid content of no less than 65% and the ratio by weight of the fruit ingredient to sweetener in the starting mixture must be no less than 45:55. Artificially sweetened fruit jelly must contain no less than 55% fruit ingredient by weight."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fudge_us_cfr_ rdfs:subClassOf :soft_candy_us_cfr_ ;
    :has_definition "Soft candy prepared by boiling milk, sugar, salt and optional ingredients to the soft-ball stage (238 degrees F.)."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:margarine_us_cfr_ rdfs:subClassOf :butter_product_analog_us_cfr_ ;
    :has_definition "Food product having functional characteristics similar to those of butter; it is in plastic form or liquid emulsion and contains not less than 80% fat whose origin is vegetable or rendered animal carcass fats or a mixture of these as well as other optional ingredients specified by 21 CFR 166.110."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fruit_or_vegetable_product_us_cfr_ rdfs:subClassOf :u_s_code_of_federal_regulations_title_21_food_product_type ;
    :has_definition "Fruits and vegetables in all forms. [FDA CFSAN 1995]"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:usa_agency_food_product_type rdfs:subClassOf :agency_food_product_type ;
    :has_definition "Food group having common consumption, functional or manufacturing characteristics, e.g. *FRUIT OR VEGETABLE PRODUCT*, *DAIRY PRODUCT*, *CONFECTIONARY*, *PREPARED FOOD PRODUCT*, etc. [FDA CFSAN 1995]"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soft_candy_us_cfr_ rdfs:subClassOf :candy_us_cfr_ ;
    :has_definition "Candy prepared by cooking a mixture of water, sugars and optional ingredients to a temperature of 250 degrees F. or less."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:butter_product_analog_us_cfr_ rdfs:subClassOf :milk_or_milk_product_analog_us_cfr_ ;
    :has_definition "Food product having functional characteristics similar to a butter product; it may be nutritionally equivalent or inferior to the product it purports to resemble."@en ;
    :has_synonym "butter substitute"@en,
        "butter, imitation"@en,
        "imitation butter"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:international_agency_food_product_type rdfs:subClassOf :agency_food_product_type ;
    :has_definition "Renamed from *PRODUCT TYPE, CODEX ALIMENTARIUS* in LanguaL 2008."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agency_food_product_type rdfs:subClassOf :food_material ;
    :has_definition "An agency food product type is a class of food product defined by an agency or consortium."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:codex_alimentarius_classification_of_food_and_feed_commodities rdfs:subClassOf :international_agency_food_product_type ;
    :has_definition """Codex Alimentarius, Volume 2 - 1993, Section 2:  Pesticide Residues in Food.

The Codex Classification of food and animal feed commodities moving in trade and the description of the various items and groups of food and animal feedstuffs included in the present document have been developed by the Codex Committee on Pesticide Residues. It was first adopted by the 18th Session of the Codex Alimentarius Commission, (1989).

The Codex Classification includes food commodities and animal feedstuffs for which Codex maximum residue limits will not necessarily be established. The Classification is intended to be as complete a listing of food commodities in trade as possible, classified into groups on the basis of the commodity's similar potential for pesticide residues.

The Classification may also be appropriate for other purposes such as setting maximum levels for other types of residues or for other contaminants in food. The Codex Classification should be consulted in order to obtain a precise description of the food or animal feed commodities and, especially, in cases where Codex maximum residue limits have been set for groups of food and groups of animal feedstuffs. The Codex Classification is intended to promote harmonization of the terms used to describe commodities which are subject to maximum residue limits and of the approach to grouping commodities with similar potential for residue for which a common group maximum residue limit can be set."""@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:02_vegetables_ccpr_ rdfs:subClassOf :a_primary_food_commodities_of_plant_origin_ccpr_ ;
    :has_definition """Vegetables are foods derived from many different kinds of plants mostly annual and usually cultivated, commonly known by custom and tradition as "vegetables".
In several countries, some of these commodities grown on large areas are distinguished as "field crops" or arable crops e.g. sugar beet. For the sake of convenience in this guide such crops are classified under Type 2 Vegetables.
Exposure to pesticides is dependent on the particular part of the plant used for food and the growing practices.
Vegetables may be consumed in whole or in part and in the form of fresh, dried or processed foods."""@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:015_pulses_vd_ccpr_ rdfs:subClassOf :02_vegetables_ccpr_ ;
    :has_definition """Pulses are derived from the mature seeds naturally or artificially dried, of leguminous plants known as beans (dry) and peas (dry).
The seeds in the pods are protected from most pesticides applied during the growing season except pesticides which show a systemic action. The dried beans and peas however are often exposed to post-harvest treatments.
The dry pulses are consumed after processing or household cooking."""@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seafood_or_related_product_eurofir_ rdfs:subClassOf :eurofir_food_classification ;
    :has_definition "The group includes marine or freshwater fish, molluscs, crustaceans, and other fauna such as reptiles, insects or frogs not in the Meats group. The group also includes seafood product analogs and seafood-based sausage or luncheon meat as well as such products as squid ink and clam juice."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seafood_product_eurofir_ rdfs:subClassOf :seafood_or_related_product_eurofir_ ;
    :has_definition "includes fish offal; a food product whose predominant constituent is fish (e.g. dried and salted fish, smoked fish, canned fish, pickled fish, restructured fish and fish analogues, surimi; fish paste, pâté)."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beverage_non_milk_eurofir_ rdfs:subClassOf :eurofir_food_classification ;
    :has_definition "Alcoholic or non-alcoholic beverage; excludes milk and milk-based beverages."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:non_alcoholic_beverage_eurofir_ rdfs:subClassOf :beverage_non_milk_eurofir_ ;
    :has_definition "Beverage containing no more than 0.5% alcohol; it may be flavoured, sweetened or carbonated; includes soft drinks and steeped beverages; excludes milk in all forms, fruit juices and vegetable juices."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coffee_tea_cocoa_or_infusion_eurofir_ rdfs:subClassOf :non_alcoholic_beverage_eurofir_ ;
    :has_definition "Beverage prepared by extracting flavour and other components from food sources by percolation and/or immersion in water, usually at near-boiling temperature. The group includes coffee (e.g. instant coffee, coffee and chicory essence), tea, herbal tea (e.g. green tea, black tea, tisane), cocoa beverage and beverage powder."@en ;
    :has_synonym "infusion"@en,
        "steeped beverage"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prepared_food_product_eurofir_ rdfs:subClassOf :miscellaneous_food_product_eurofir_ ;
    :has_definition "This subgroup includes multicomponent meals, sauces, retail salads, desserts, soups, snacks and other foods where similarity of the product type is more significant than the source of the principal ingredient(s)."@en ;
    :has_synonym "soup, sauce or miscellaneous food product"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soup_eurofir_ rdfs:subClassOf :prepared_food_product_eurofir_ ;
    :has_definition "A liquid food made by simmering meat, poultry, seafood or vegetables, being clear or thickened to the consistency of a thin puree or having milk or cream added, and often containing pieces of solid food such as meat, shellfish, pasta or vegetables. Soup takes precedence over other food products. Examples are egg and lemon soup, oxtail soup, fish soup, rice soup, lentil soup, minestrone, cherry soup."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gs1_global_product_classification_gpc_ rdfs:subClassOf :international_agency_food_product_type ;
    :has_definition """The Global System 1 (GS1) Global Product Classification (GPC) is a system that gives buyers and sellers a common language for grouping products in the same way, everywhere in the world.$br/$
The GS1 GPC classification in facet A is currently updated based on June 2017 release of GS1 GPC Standard for Food/Beverage/Tobacco, except for codes pertaining to tobacco. See the GS1 site for details [https://www.gs1.org/standards/gpc]."""@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:u_s_code_of_federal_regulations_title_21_food_product_type rdfs:subClassOf :usa_agency_food_product_type ;
    :has_definition "Food and Drugs, title 21, Code of Federal Regulations. Original food classification in LanguaL."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:devils_tongue_plant rdfs:subClassOf :starch_producing_plant ;
    :has_synonym "amorphophallus konjac"@en,
        "amorphophallus rivieri"@en,
        "hydrosme rivieri"@en,
        "leopard palm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sugar rdfs:subClassOf :carbohydrate_extract_concentrate_or_isolate ;
    :has_definition "A broad term that includes the nutritive sweeteners dextrose, fructose, galactose, lactose, maltose and sucrose, which are simple carbohydrates with molecules composed of one or two saccharide units. Note that on a product label or in a recipe, 'sugar' means *SUCROSE* and should be so indexed. Use the broad term *SUGAR* only if the specific sugar used is not known or not listed in the vocabulary."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbohydrate_extract_concentrate_or_isolate rdfs:subClassOf :extract_concentrate_or_isolate_of_plant_or_animal ;
    :has_definition "Extract, concentrate or isolate high in sugar, oligosaccharide or polysaccharide."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_sugar rdfs:subClassOf :sugar_condiment,
        :sugar_granulated_ ;
    :has_definition "Soft sugar whose crystals are covered by a film of refined dark syrup that imparts color, flavor, and moisture."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extract_concentrate_or_isolate_of_plant_or_animal rdfs:subClassOf :food_product_component ;
    :has_definition "A physical-chemical component separated from the food source or its parts by extraction, centrifugation, filtration, heat processing, expressing or a similar process. The separated component may be converted through further processing. If this is done, the final substance is indexed. A water-extracted component may remain in aqueous dispersion. The extract, concentrate or isolate is indexed in preference to the anatomic part from which it is derived. For example, peanut oil is indexed under *PEANUT* combined wih *FAT OR OIL* rather than with *SEED OR KERNEL*. On the other hand, fruit and vegetable juices can be indexed under *FRUIT JUICE OR NECTAR* or *VEGETABLE JUICE* (A. PRODUCT TYPE); therefore the anatomic part of the plant should be indexed."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mammalian_milk_whey rdfs:subClassOf :mammalian_milk_product ;
    :has_definition "The serum or watery part of milk that is separated from the thicker or more coagulable part or curd, espcially in the process of making cheese; it contains lactose, minerals and lactalbumin."@en ;
    :has_exact_synonym "whey"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seed_oil rdfs:subClassOf :vegetable_oil_food_product ;
    :has_definition "The oil produced by pressing or extracting lipids from plant seeds (e.g. grapeseed oil, rapeseed oil, linseed oil) /AM"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_liquid_low_viscosity_ rdfs:subClassOf :food_liquid_ ;
    :has_definition "A liquid that flows very easily at room temperature. Examples are: water, apple juice, sherry, acidophilus milk, whipping cream and some heavy liqueurs. The range of low viscosity liquid spans sucrose solutions between 0 and 45% solids (viscosity range from 1 to 10 centipoise). Prefer 'solid pieces' factor term to 'small particles' if both appear in the food."@en ;
    :has_synonym "liquid, thin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_liquid_ rdfs:subClassOf :food_product_by_quality ;
    :has_definition "A state of matter between a solid and a gas, in which a substance has the capacity to flow and conforms to the shape of the container. Liquids range from water to honey, corresponding to a range in viscosity (or apparent viscosity) from 1 to 500 centipoise (viscosity is a measure of a liquid's resistance to flow). Products that are pourable but have a higher viscosity are *SEMILIQUID*."@en ;
    :has_synonym "fluid"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_seed_or_nut_food_product rdfs:subClassOf :plant_food_product ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :nut_food_product ;
                    rdf:rest [ rdf:first :plant_seed_food_product ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "nut or seed added"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chocolate_or_cocoa rdfs:subClassOf :cacao_food_product ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :chocolate_food_product ;
                    rdf:rest [ rdf:first :cocoa_food_product ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "chocolate or cocoa added"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vegetable_fat_or_oil rdfs:subClassOf :plant_lipid_food_product ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :vegetable_oil_food_product ;
                    rdf:rest [ rdf:first :vegetable_fat_food_product ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "vegetable fat or oil added"@en ;
    :has_definition "A fat or oil derived from vegetable material"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:system_process rdfs:subClassOf :multicellular_organismal_process ;
    :has_definition "A multicellular organismal process carried out by any of the organs or tissues in an organ system. An organ system is a regularly interacting or interdependent group of organs or tissues that work together to carry out a biological objective." ;
    :has_exact_synonym "organ system process" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:excretion rdfs:subClassOf :system_process ;
    :has_definition "The elimination by an organism of the waste products that arise as a result of metabolic activity. These products include water, carbon dioxide (CO2), and nitrogenous compounds." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biological_process rdfs:subClassOf :process ;
    :has_definition "A biological process represents a specific objective that the organism is genetically programmed to achieve. Biological processes are often described by their outcome or ending state, e.g., the biological process of cell division results in the creation of two daughter cells (a divided cell) from a single parent cell. A biological process is accomplished by a particular set of molecular functions carried out by specific gene products (or macromolecular complexes), often in a highly regulated manner and in a particular temporal sequence." ;
    :has_exact_synonym "biological process",
        "physiological process" ;
    :has_related_synonym "single organism process",
        "single-organism process" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multicellular_organismal_process rdfs:subClassOf :biological_process ;
    :has_definition "Any biological process, occurring at the level of a multicellular organism, pertinent to its function." ;
    :has_exact_synonym "organismal physiological process" ;
    :has_related_synonym "single-multicellular organism process" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:objective_specification rdfs:subClassOf :directive_information_entity ;
    :has_definition "A directive information entity that describes an intended process endpoint. When part of a plan specification the concretization is realized in a planned process in which the bearer tries to effect the world so that the process endpoint is achieved."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:action_specification rdfs:subClassOf :directive_information_entity ;
    :has_definition "A directive information entity that describes an action the bearer will take."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:data_item rdfs:subClassOf :information_content_entity ;
    :has_definition "An information content entity that is intended to be a truthful statement about something (modulo, e.g., measurement precision or other systematic errors) and is constructed/acquired by a method which reliably tends to produce (approximately) truthful statements."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:information_content_entity rdfs:subClassOf :generically_dependent_continuant ;
    :has_definition "A generically dependent continuant that is about some thing."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:scalar_measurement_datum rdfs:subClassOf [ a owl:Restriction ;
            owl:minCardinality "1"^^xsd:nonNegativeInteger ;
            owl:onProperty :iao_0000004 ],
        :measurement_datum ;
    :has_definition "A scalar measurement datum is a measurement datum that is composed of two parts, numerals and a unit label."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:directive_information_entity rdfs:subClassOf :information_content_entity ;
    :has_definition "An information content entity whose concretizations indicate to their bearer how to realize them in a process."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:data_set rdfs:subClassOf :data_item ;
    :has_definition "A data item that is an aggregate of other data items of the same type that have something in common. Averages and distributions can be determined for data sets."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:image rdfs:subClassOf :figure ;
    :has_definition "An image is an affine projection to a two dimensional surface, of measurements of some quality of an entity or entities repeated at regular intervals across a spatial range, where the measurements are represented as color and luminosity on the projected on surface."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plan_specification rdfs:subClassOf :directive_information_entity ;
    :has_definition "A directive information entity with action specifications and objective specifications as parts that, when concretized, is realized in a process in which the bearer tries to achieve the objectives by taking the actions specified."@en,
        "A directive information entity with action specifications and objective specifications as parts, and that may be concretized as a realizable entity that, if realized, is realized in a process in which the bearer tries to achieve the objectives by taking the actions specified."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:measurement_datum rdfs:subClassOf :data_item ;
    :has_definition "A measurement datum is an information content entity that is a recording of the output of a measurement such as produced by a device."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:figure rdfs:subClassOf :information_content_entity ;
    :has_definition "An information content entity consisting of a two dimensional arrangement of information content entities such that the arrangement itself is about something."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:time_sampled_measurement_data_set rdfs:subClassOf :data_set ;
    :has_definition "A data set that is an aggregate of data recording some measurement at a number of time points. The time series data set is an ordered list of pairs of time measurement data and the corresponding measurement data acquired at that time."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viridiplantae rdfs:subClassOf :eukaryota ;
    :has_exact_synonym "Chlorophyta/Embryophyta group",
        "chlorophyte/embryophyte group",
        "green plants" ;
    :has_related_synonym "Chlorobionta",
        "Chloroplastida",
        "green plants" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cyrtacanthacridinae rdfs:subClassOf :acrididae ;
    :has_exact_synonym "migratory bird locusts",
        "spur-throated grasshoppers",
        "spur-throated locusts" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planned_process rdfs:subClassOf :process ;
    :has_definition "A process that realizes a plan which is the concretization of a plan specification."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:processed_material rdfs:subClassOf :material_entity ;
    :has_definition "Is a material entity that is created or changed during material processing."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_control_function rdfs:subClassOf :function ;
    :has_definition "An environmental control function is a function that regulates a contained environment within specified parameter ranges. For example the control of light exposure, humidity and temperature."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:container rdfs:subClassOf :device ;
    :has_definition "A device that can be used to restrict the location of material entities over time" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:container rdfs:subClassOf :device ;
    :has_definition "A device that can be used to restrict the location of material entities over time" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:device rdfs:subClassOf :manufactured_product,
        :processed_material ;
    :has_definition "A material entity that is designed to perform a function in a scientific investigation, but is not a reagent." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organism rdfs:subClassOf :material_entity ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :viruses ;
                    rdf:rest [ rdf:first :bacteria ;
                            rdf:rest [ rdf:first :archaea ;
                                    rdf:rest [ rdf:first :eukaryota ;
                                            rdf:rest :nil ] ] ] ] ] ;
    :has_definition "A material entity that is an individual living system, such as animal, plant, bacteria or virus, that is capable of replicating or reproducing, growth and maintenance in the right environment. An organism may be unicellular or made up, like humans, of many billions of cells divided into specialized tissues and organs."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:quality rdfs:subClassOf :specifically_dependent_continuant ;
    :has_definition "A dependent entity that inheres in a bearer by virtue of how the bearer is related to other entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:speed rdfs:subClassOf :movement_quality ;
    :has_definition "A physical quality inhering in a bearer by virtue of the bearer's scalar absolute value of the rate of change of the bearer's position." ;
    :has_related_synonym "velocity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:age rdfs:subClassOf :time ;
    :has_definition "A time quality inhering in a bearer by virtue of how long the bearer has existed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:color rdfs:subClassOf :morphology,
        :optical_quality ;
    :has_definition "A composite chromatic quality composed of hue, saturation and intensity parts." ;
    :has_exact_synonym "colour",
        "relative color" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fluorescence rdfs:subClassOf :luminous_flux ;
    :has_definition "A luminous flux quality inhering in a bearer by virtue of the bearer's emitting longer wavelength light following the absorption of shorter wavelength radiation; fluorescence is common with aromatic compounds with several rings joined together." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:color_pattern rdfs:subClassOf :spatial_pattern ;
    :has_definition "A chromatic property that is the relative position of different hues or degrees of saturation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:composition rdfs:subClassOf :structure ;
    :has_definition "A single physical entity inhering in an bearer by virtue of the bearer's quantities or relative ratios of subparts." ;
    :has_exact_synonym "composed of",
        "compositionality",
        "content",
        "structure, composition" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:concentration_of rdfs:subClassOf :molecular_quality ;
    :has_definition "A quality inhering in a substance by virtue of the amount of the bearer's there is mixed with another substance." ;
    :has_exact_synonym "concentration" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:direction rdfs:subClassOf :physical_quality ;
    :has_definition "A physical quality inhering in a bearer by virtue of the bearer's orientation in space." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frequency rdfs:subClassOf :rate_of_occurence ;
    :has_definition "A physical quality which inheres in a bearer by virtue of the number of the bearer's repetitive actions in a particular time." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hardness rdfs:subClassOf :quality_of_a_solid ;
    :has_definition "A physical quality inhering in a bearer by virtue of the bearer's resistance to pressure, being broken, or pierced" ;
    :has_related_synonym "impenetrability",
        "toughness" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intensity rdfs:subClassOf :qualitative ;
    :has_definition "A quality inhering in a bearer by virtue of the bearer's possessing or displaying a distinctive feature in type or degree or effect or force." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:morphology rdfs:subClassOf :physical_object_quality ;
    :has_definition "A quality of a single physical entity inhering in the bearer by virtue of the bearer's size or shape or structure." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shape rdfs:subClassOf :morphology ;
    :has_definition "A morphological quality inhering in a bearer by virtue of the bearer's ratios of distances between its features (points, edges, surfaces and also holes etc)." ;
    :has_exact_synonym "relational shape quality" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:occurrence rdfs:subClassOf :temporal_distribution_quality ;
    :has_broad_synonym "temporal" ;
    :has_definition "A quality of a single process inhering in a bearer by virtue of the bearer's occurrence." ;
    :has_exact_synonym "incidence" .
